import React from 'react';

export default class GraphEffect extends React.Component {
  constructor(props) {
    super(props);
  }
  componentDidMount() {
    const s = document.createElement('script');
    s.src = "graph.js";
    s.async = true;
    this.div.appendChild(s);
  }
  render() {
    return (
        <div ref={el => (this.div = el)} >
            <p>Test</p>
        </div>
    );
  }
}
